import React, { useState } from 'react';

const AuctioneerDashboard = () => {
  const [itemName, setItemName] = useState('');
  const [itemDescription, setItemDescription] = useState('');
  const [itemImages, setItemImages] = useState([]);
  const [startingBid, setStartingBid] = useState('');
  const [category, setCategory] = useState('');
  const [items, setItems] = useState([]); // List of auction items

  const categories = [
    'Motor Vehicles', 'Electronics', 'Land & Real Estate', 'Furniture',
    'Art & Collectibles', 'Jewelry & Watches', 'Antiques', 'Machinery'
  ];

  const handleAddItem = (e) => {
    e.preventDefault();

    // Validate image count
    if (itemImages.length < 1 || itemImages.length > 10) {
      alert('Please upload between 1 and 10 images.');
      return;
    }

    const newItem = {
      name: itemName,
      description: itemDescription,
      images: itemImages,
      startingBid: startingBid,
      category: category,
      status: 'pending', // Set status to 'pending' for admin approval
    };

    setItems([...items, newItem]);
    setItemName('');
    setItemDescription('');
    setItemImages([]);
    setStartingBid('');
    setCategory('');
  };

  const handleImageChange = (e) => {
    const files = Array.from(e.target.files);
    if (files.length > 10) {
      alert('You can upload a maximum of 10 images.');
      return;
    }
    setItemImages(files);
  };

  return (
    <div className="container mx-auto p-6">
      <h1 className="text-3xl font-semibold">Auctioneer Dashboard</h1>
      <div className="mt-6">
        <h2 className="text-2xl font-medium">Add Item to Auction</h2>
        <form onSubmit={handleAddItem} className="mt-4">
          {/* Item Name, Description, Images, etc. */}
          <div className="mb-4">
            <label htmlFor="itemName" className="block text-lg font-medium">Item Name</label>
            <input
              type="text"
              id="itemName"
              value={itemName}
              onChange={(e) => setItemName(e.target.value)}
              className="w-full p-2 border border-gray-300 rounded mt-2"
              required
            />
          </div>

          <div className="mb-4">
            <label htmlFor="itemDescription" className="block text-lg font-medium">Item Description</label>
            <textarea
              id="itemDescription"
              value={itemDescription}
              onChange={(e) => setItemDescription(e.target.value)}
              className="w-full p-2 border border-gray-300 rounded mt-2"
              required
            />
          </div>

          <div className="mb-4">
            <label htmlFor="itemImages" className="block text-lg font-medium">Item Images (1-10)</label>
            <input
              type="file"
              id="itemImages"
              onChange={handleImageChange}
              className="w-full p-2 border border-gray-300 rounded mt-2"
              accept="image/*"
              multiple
              required
            />
            <p className="text-sm text-gray-500 mt-2">Select up to 10 images.</p>
          </div>

          <div className="mb-4">
            <label htmlFor="startingBid" className="block text-lg font-medium">Starting Bid</label>
            <input
              type="number"
              id="startingBid"
              value={startingBid}
              onChange={(e) => setStartingBid(e.target.value)}
              className="w-full p-2 border border-gray-300 rounded mt-2"
              required
            />
          </div>

          <div className="mb-4">
            <label htmlFor="category" className="block text-lg font-medium">Category</label>
            <select
              id="category"
              value={category}
              onChange={(e) => setCategory(e.target.value)}
              className="w-full p-2 border border-gray-300 rounded mt-2"
              required
            >
              <option value="">Select Category</option>
              {categories.map((cat) => (
                <option key={cat} value={cat}>{cat}</option>
              ))}
            </select>
          </div>

          <button type="submit" className="bg-blue-600 text-white p-2 rounded">Submit Item for Approval</button>
        </form>
      </div>
    </div>
  );
};

export default AuctioneerDashboard;
